&lt;p&gt;
The ZSE2 series is a compact, pressure switch (for vacuum pressure) and can be integrated with ZX or ZR vacuum systems. The ZSE2 series pressure switch has a quick response time of 10mS and the plug connector option makes wiring easy and simple.
&lt;/p&gt;

